<!doctype html>
<html lang="ja">
<head>
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <meta charset="UTF-8">
  <meta property="og:title" content="アカウント設定" />
  <meta property="og:description" content="設定" />
  <title>設定画面</title>    
  <script src="https://code.jquery.com/jquery-1.11.3.min.js" type="text/javascript"></script>

  <style>
    body {
      font-family: Arial, sans-serif;
      background-color: #f4f4f9;
      padding: 20px;
    }
    h2 {
      text-align: center;
      color: #333;
    }
    .container {
      max-width: 600px;
      margin: 0 auto;
      padding: 20px;
      background-color: white;
      border-radius: 8px;
      box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
    }
    .form-group {
      margin-bottom: 15px;
    }
    button {
      padding: 10px 20px;
      border: none;
      border-radius: 4px;
      cursor: pointer;
      transition: background-color 0.3s ease-in-out;
    }
    #logout-button {
      background-color: #dc3545;
      color: white;
      width: 100%;
    }
    #logout-button:hover {
      background-color: #c82333;
    }
    #change-password-button {
      background-color: #4a90e2;
      color: white;
      width: 100%;
    }
    #change-password-button:hover {
      background-color: #357abd;
    }
    #change-name-button {
      background-color: #4a90e2;
      color: white;
      width: 100%;
    }
    #change-name-button:hover {
      background-color: #357abd;
    }
    #settings-section, #domain-section {
      display: none; /* デフォルトでは非表示（ログインしていない場合） */
    }
    #domain-section {
      margin-top: 30px;
    }
    #trusted-domains-list {
      list-style-type: none;
      padding: 0;
    }
    #trusted-domains-list li {
      background-color: #f8f9fa;
      border: 1px solid #ddd;
      border-radius: 4px;
      margin-bottom: 10px;
      padding: 10px;
      display: flex;
      justify-content: space-between;
      align-items: center;
    }
    .domain-buttons button {
      margin-left: 10px;
      background-color: #dc3545;
      color: white;
      border: none;
      padding: 5px 10px;
      border-radius: 4px;
      cursor: pointer;
    }
    .domain-buttons button:hover {
      background-color: #c82333;
    }
    input[type="text"] {
  width: calc(100% - 22px); /* 幅を調整し、ボタンと合わせる */
  padding: 10px;
  border: 1px solid #ccc;
  border-radius: 4px;
  font-size: 16px;
  box-sizing: border-box; /* パディングとボーダーを含めたサイズ調整 */
  margin-right: 10px; /* ボタンとの間隔 */
}

input[type="text"]::placeholder {
  color: #999;
  font-style: italic;
}

input[type="text"]:focus {
  border-color: #4a90e2;
  outline: none;
  box-shadow: 0 0 5px rgba(74, 144, 226, 0.2);
}

input[type="text"]:disabled {
  background-color: #f5f5f5;
  cursor: not-allowed;
}
  </style>

<body>
  <h2>設定画面</h2>
  <div class="container">
    <p id="username">ログイン状態を確認中...</p>
    <div id="loading">
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32" width="48" height="48" fill="#2589d0">
        <path d="M14 0 H18 V8 H14 z" transform="rotate(0 16 16)" opacity=".1">
          <animate attributeName="opacity" from="1" to=".1" begin="0" dur="1s" repeatCount="indefinite"/>
        </path>
        <path d="M14 0 H18 V8 H14 z" transform="rotate(45 16 16)" opacity=".1">
          <animate attributeName="opacity" from="1" to=".1" begin="0.125s" dur="1s" repeatCount="indefinite"/>
        </path>
        <path d="M14 0 H18 V8 H14 z" transform="rotate(90 16 16)" opacity=".1">
          <animate attributeName="opacity" from="1" to=".1" begin="0.25s" dur="1s" repeatCount="indefinite"/>
        </path>
        <path d="M14 0 H18 V8 H14 z" transform="rotate(135 16 16)" opacity=".1">
          <animate attributeName="opacity" from="1" to=".1" begin="0.375s" dur="1s" repeatCount="indefinite"/>
        </path>
        <path d="M14 0 H18 V8 H14 z" transform="rotate(180 16 16)" opacity=".1">
          <animate attributeName="opacity" from="1" to=".1" begin="0.5s" dur="1s" repeatCount="indefinite"/>
        </path>
        <path d="M14 0 H18 V8 H14 z" transform="rotate(225 16 16)" opacity=".1">
          <animate attributeName="opacity" from="1" to=".1" begin="0.625s" dur="1s" repeatCount="indefinite"/>
        </path>
        <path d="M14 0 H18 V8 H14 z" transform="rotate(270 16 16)" opacity=".1">
          <animate attributeName="opacity" from="1" to=".1" begin="0.75s" dur="1s" repeatCount="indefinite"/>
        </path>
        <path d="M14 0 H18 V8 H14 z" transform="rotate(315 16 16)" opacity=".1">
          <animate attributeName="opacity" from="1" to=".1" begin="0.875s" dur="1s" repeatCount="indefinite"/>
        </path>
      </svg>
    </div>

    <div id="settings-section">
      <h3>アカウント設定</h3>
      <p>この画面からアカウントの設定やログアウトが行えます。</p>
      <div class="form-group">
        <button id="change-password-button">パスワード変更</button>
        <p></p>
        <button id="change-name-button">名前を変更</button>
      </div>
      <div class="form-group">
        <button id="logout-button">ログアウト</button>
      </div>
    </div>

    <div id="domain-section">
      <h3>信頼しているドメイン</h3>
      <p>信頼しているドメインの管理ができます。</p>
      <div class="form-group">
        <input type="text" id="new-domain" placeholder="信頼するドメインを入力してください">
        <button id="add-domain-button">追加</button>
      </div>
      <ul id="trusted-domains-list">
      </ul>
    </div>
  </div>
</body>
</html>
